import React from "react";
import { connect } from "react-redux";
import { Table } from "reactstrap";

const mapStateToProps = (state) => {
  return {
    getDetailList: state.getDetailList,
    errorDetailList: state.errorDetailList,
  };
};

const DetailComponent = (props) => {
  return (
    <Table striped>
    <tbody>
      <tr>
        <td width="200">Nama</td>
        <td width="10">:</td>
        <td>{props.getUserDetail.nama}</td>
      </tr>
      <tr>
        <td width="200">Alamat</td>
        <td width="10">:</td>
        <td>{props.getUserDetail.alamat}</td>
      </tr>
      <tr>
        <td width="200">Umur</td>
        <td width="10">:</td>
        <td>{props.getUserDetail.umur}</td>
      </tr>
      <tr>
        <td width="200">No HP</td>
        <td width="10">:</td>
        <td>{props.getUserDetail.nohp}</td>
      </tr>

    </tbody>
  </Table>
  );
};

export default connect(mapStateToProps, null)(DetailComponent);
